import React from 'react';

const herissonMondonBase64 =
  'data:image/svg+xml;base64,';

export class IllustrationMondon extends React.Component<
  React.DetailedHTMLProps<React.HTMLAttributes<HTMLImageElement>, HTMLImageElement>,
  {}
> {
  public static displayName = 'Illusatation_Mondon';

  public render(): JSX.Element {
    return <img {...this.props} src={herissonMondonBase64} />;
  }
}
